import React from "react";
import AddIcon from "@mui/icons-material/Add";
import styled from "styled-components";

const Button = styled.button`
  background-color: rgba(249, 249, 249, 0.2);
  border-radius: 15px;
  padding: 19px 25px;
  color: ${({ theme }) => (theme.isDarkMode ? "#fff" : "black")};
  position: absolute;
  left: 0;
  bottom: 0;
  z-index: 11;
  border: none;
  margin-bottom: 21px;
  margin-left: 20px;
  display: flex;
  align-items: center;
  font-size: 18px;
  line-height: 18px;
  font-weight: 800;
  font-family: Lato;
`;

const Watchlist = () => {
  return (
    <Button>
      <AddIcon sx={{ fontSize: "33px" }} /> Watchlist
    </Button>
  );
};

export default Watchlist;
